import {
  IonCard,
  IonCardHeader,
  IonCardSubtitle,
  IonCardTitle,
} from "@ionic/react";
import React, { ReactComponentElement } from "react";

const CardList: React.FC = () => {
  return (
    <IonCard>
      <IonCardHeader>
        <IonCardTitle>Title</IonCardTitle>
        <IonCardSubtitle>Subtitle</IonCardSubtitle>
      </IonCardHeader>
    </IonCard>
  );
};

export default CardList;
